Diagnosis. The male of
Penniverpa festina
is similar to P. i n s u l a r and is separated from P. i n s u l a r by having the tarsi dark brown, the PVL being present in the form of a narrow, basal spinous projection on the ventral lobe (
Fig. 39
), the LGP of the gonostylus (
Fig. 39
) with numerous, distinctive, thick, black macrosetae apically and the VMP positioned mediolaterally and shorter than the length of the LGP. The female of P. f e s t i n a is separated from P. i n s u l a r in having white pubescence (
Fig. 83
) across the posterior margin of tergites 1–3 and posterolaterally on tergites 5–6 ; furca (
Fig. 43
) oblong, sides constricted.

Abdomen. Tergite 1 dark brown, pubescence white, dense posteriorly; tergite 2 dull orange with dark brown anteromedial area, pubescence white, dense; tergites 3–8 dull orange, pubescence white, dense; dorsal setae white, elongate, appressed, denser across posterior margins.
Terminalia
(MEI 128494 ). Dark brown. Tergite 8 (
Fig. 36
), posterior margin deeply emarginate; setae yellow with scattered dark reddish brown setae. Sternite 8 (
Fig. 37
), setae dark reddish brown, absent medially on posterior margin. Epandrium (
Fig. 36
), setae dark reddish brown, thicker than setae on tergite 8 . Cercus (
Fig. 36
), ending basal to apex of hypoproct. Hypoproct (
Fig. 36
), posterior margin rounded, ending distal to apex of cercus. Gonocoxite ventral view (
Fig. 37
), setae dark reddish brown with scattered dark reddish brown macrosetae; lateral view (
Fig. 38
) globular with elongate inner gonocoxal process; ventral lobe (
Fig. 39
), PVL in form of short, basal, spinous projection. Gonostylus (
Fig. 39
), LGP oblong, apical macrosetae black, coarse, VMP elongate. Aedeagus with dorsal apodeme (
Fig. 40
), anterior margin truncate; ventral apodeme (
Fig. 41
) ending at anterior margin of dorsal apodeme; distiphallus dorsal view (
Fig. 40
) constricted basally, elongate, oval, tapered posteriorly with spinous dorsal projections, ventral view (
Fig. 41
) AAP with apical spinous projections, lateral view (
Fig. 42
), extended posteriorly or as a broad curve ventrally.

